ch changes.\"',NULL,'2016-03-31 14:02:17',0),(5429,1572,2,'D(III) \"Interlibrary Loan. Licensee may provide to other libraries or academic institutions requests to provide reasonable amounts of the Licensed Property through interlibrary loan arrangements.\"',NULL,'2016-03-31 14:02:48',1),(5430,1572,13,'[IMPLIED]  D(I) \"Electronic Reserves. Licensee and Authorized Users may use a reasonable portion of the Licensed Property for use in connection with specific courses of instruction offered by Licensee.\"',NULL,'2016-03-31 14:03:53',1),(5431,1572,14,'[IMPLIED] - Copyright Act',NULL,'2016-03-31 14:05:03',1),(5432,1572,16,'G. Archiving and Perpetual Access\nACP acknowledges that Licensee may participate in the LOCKSS system (www.lockss.org) for archiving digitized publications. Licensee may perpetually use the LOCKSS system to archive and restore the Licensed Property, so long as Licensee\'s use is otherwise consistent with this Agreement. ACP further acknowledges and agrees that, for the purpose of repairing damage to or loss of another LOCKSS system\'s copy of Licensed Property, Licensee\'s LOCKSS system may make Licensed Property available to that other LOCKSS system provided that the other LOCKSS system had previously proven to Licensee\'s system that it had the same Licensed Property.',NULL,'2016-03-31 14:05:48',0),(5433,1574,11,'\"Users are defined as faculty, students, researchers, administration, consultants, and walk-ins.\"',NULL,'2016-03-31 16:54:51',0),(5434,1574,14,'\"Authorized users may download, search, and save materials for his or her personal use.  Single printed copies of individual articles may be made for private use or research but no further reproduction is permitted and no multiple copies may be made for classroom use without specific permission.\"',NULL,'2016-03-31 16:55:34',1),(5435,1574,2,'\"The ACSESS Products may not be used to supply single articles, individual book chapters, proceedings, or other individual items to ILL requesters that are