ork in electronic\ncourse packs and course management systems for use in connection with courses offered by\nthe Licensee for academic credit provided that no person other than an Authorized User may\nuse such links.',NULL,'2016-05-30 21:08:47',1),(5467,1594,2,'2.6 Where the Licensee is an academic library, or library which is part of a non-commercial\norganisation, then notwithstanding any restriction in Clause 2.3, the Licensor hereby grants the\nLicensee the non-exclusive right during the Licensed Work Term for each Licensed Work,\nrespectively, to supply (whether by post, fax or secure electronic transmission, using Arid or its\nequivalent, whereby the electronic file is deleted after priming) another academic library or library\nwhich is part of a non-commercial organisation, for the purposes supplying an Authorized User of\nthe recipient library with a single copy of an electronic original of an individual document from a\nLicensed Work for the purpose of research or private study and not for Commercial Use. ',NULL,'2016-05-30 21:11:00',1),(5468,1594,6,'2.2.4 if the Licensee is an academic institution, carry out Non-Commercial Text And Data Mining\nin relation to the Licensed Work or portions thereof, including making and storing copies\nprovided that:\n2.2.4.1. such copies arc made and stored only to the extent necessary for the purposes of such\ncomputational analysis;\n2.2.4.2. such copies are not transferred to any other person or used for any other purpose\nwithout the Licensers consent;\n2.2.4.3. such copies are destroyed once they are no longer necessary for the relevant\ncomputational analysis;\n2.2.4.4. the Authorized Users acknowledge the use of the Licensed Work if any results of the\ncomputational analysis are published; and\n2.2.4.5. the Authorized Users comply with all Licensor usage policies communicated to them\nor made available to them, including without limitation any security measures and\nconditions of access; and, except as permitted by J