uch purpose. Course packs in nonelectronic\nnonprint perceptible form, such as audio or Braille, may also be offered to Authorized Users who, in the reasonable opinion of the Member, are visually impaired\"','3.2.4 - \"Distribute single copies of individual articles or items of the Licensed Materials in print or electronic form to other Authorized Users; for the avoidance of doubt, this subclause shall include the distribution of a copy for teaching purposes to all individual student Authorized Users in a class at a Member.\"','12.4 - Yes',NULL,NULL,NULL),('Adenine Press',NULL,'License - Signed','Adenine Press','UofA','4 - \"those individuals officially affiliated with the Licensee  such as employees, faculty, students, visiting scientists, and other visitors to the institution\"',NULL,NULL,'8 - \"Interlibrary loans are limited only to the print version.  The Licensee is not allowed to allow accss to JBSD Online by other libraries.  However, if the library is in possession of a print plus online subscription, it may download the pdf of the article, print it, and mail it to another library\"',NULL,NULL,NULL,'6 - \"Any Authorized User may make multiple copites of material in JBSD Online for free distribution to students in a course.  An acknowledgement  should appear in such materials:  Reprinted with permission from: Journal of Biomolecular Stucture and Dynamics (year of publication) c Adenine Press\"',NULL,NULL,NULL,NULL),('ADIS Online',NULL,'License - Signed','Adis International','UofA','4.1.1 - \"faculty members (including temporary or exchange faculty for the duration of their assignment); graduate and undergraduate students and staff members\". 4.1.2 - \"members of the public  from workstations on library premises\"',NULL,NULL,'4.2.5 -  \"The electronic form of the Licensed Materials may be used as a source for Interlibrary Loan whereby articles can be printed and these print copies be delivered via postal mail or fax fo fultill ILL requests from an academick, r